        <span role="img" aria-label="lock">üîê</span> AI IDS/IPS
      </h1>
      <div className="space-x-6">
        <a href="/" className="hover:text-gray-400">Home</a>
        <a href="/logs" className="hover:text-gray-400">Logs</a>
        <a href="/attacks" className="hover:text-gray-400">Attacks</a>
        <a href="/detect" className="hover:text-gray-400">Detect Attack</a>
      </div>
    </nav>
  );
};

export default Navbar;
